import React, { useState } from 'react';

const FormularioAtleta = ({ aoSalvar, aoCancelar }) => {
  const [nome, setNome] = useState('');
  const [categoria, setCategoria] = useState('Masculino A');

  const enviar = (e) => {
    e.preventDefault();
    alert('Atleta ' + nome + ' cadastrado na categoria ' + categoria + '!');
    aoSalvar();
  };

  return (
    <div style={{ backgroundColor: '#fff', padding: '20px', borderRadius: '8px', border: '1px solid #ddd', marginBottom: '20px' }}>
      <h4>üìù Cadastrar Novo Jogador</h4>
      <form onSubmit={enviar}>
        <div style={{ marginBottom: '10px' }}>
          <label>Nome do Atleta: </label><br/>
          <input 
            type="text" 
            value={nome} 
            onChange={(e) => setNome(e.target.value)} 
            style={{ width: '100%', padding: '8px', borderRadius: '4px', border: '1px solid #ccc' }} 
            placeholder="Digite o nome completo"
            required
          />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label>Escolha a Categoria Oficial: </label><br/>
          <select value={categoria} onChange={(e) => setCategoria(e.target.value)} style={{ width: '100%', padding: '8px', borderRadius: '4px' }}>
            <optgroup label="Masculino">
              <option value="Masculino A">Masculino A (Pr√≥)</option>
              <option value="Masculino B">Masculino B</option>
              <option value="Masculino C">Masculino C</option>
              <option value="Masculino D">Masculino D (Iniciante)</option>
            </optgroup>
            <optgroup label="Feminino">
              <option value="Feminino A">Feminino A</option>
              <option value="Feminino B">Feminino B</option>
              <option value="Feminino C">Feminino C</option>
              <option value="Feminino D">Feminino D</option>
            </optgroup>
            <optgroup label="Mista">
              <option value="Mista A">Mista A</option>
              <option value="Mista B">Mista B</option>
              <option value="Mista C">Mista C</option>
            </optgroup>
            <optgroup label="Idade / Especial">
              <option value="Sub-14">Sub-14 (Kids)</option>
              <option value="40+">Master 40+</option>
              <option value="50+">Master 50+</option>
            </optgroup>
          </select>
        </div>
        <button type="submit" style={{ backgroundColor: '#28a745', color: 'white', border: 'none', padding: '10px 15px', borderRadius: '5px', cursor: 'pointer', marginRight: '10px', fontWeight: 'bold' }}>
          Confirmar Cadastro
        </button>
        <button type="button" onClick={aoCancelar} style={{ backgroundColor: '#dc3545', color: 'white', border: 'none', padding: '10px 15px', borderRadius: '5px', cursor: 'pointer' }}>
          Cancelar
        </button>
      </form>
    </div>
  );
};

export default FormularioAtleta;
